    number: '6'
    value: 'Sch H4 Explanations: Transfer of $18,651.82 made on 8/1/07 from the Federal
      account to the Non-Federal account for administrative in-kinds that occurred
      in the prior reporting period 1/1/07-6/30/07.  Transfer of $13,889.78 made on
      8/1/07 from the Federal account to the Non-Federal account for MD-08 in-kinds
      that occurred in the prior reporting period of 1/1/07-6/30/07.  Transfer of
      $3,900.00 made on 8/1/07 from the Federal account to the Non-Federal account
      in escrow for administrative in-kinds reported on 9/8/07 for $1,500, 9/9/07
      for $2,643, and 9/7/07 for $6,896.  Transfer of $2,500 made on 9/10/07 from
      the Federal account to the Non-Federal account in escrow for administrative
      in-kinds that will be reported in the next reporting cycle.   As of 9/30/07
      there is an escrow balance for administrative in-kinds in the amount of $3,309.08.  Transfer
      of $1,100.00 made on 8/1/07 from the Federal account to the Non-Federal account
      in escrow for MD-08 in-kinds reported on 9/6/07 for $7,065.22, 9/7/07 for $2,970,
      9/7/07 for $1,264 and 9/7/07 for $1,350.  Transfer of $2,500 made on 9/10/07
      from the Federal account to the Non-Federal account in escrow for MD-08 in-kinds
      reported on 9/12/07 for $1,878, 9/18/07 for $3,574.40, and 9/29/07 for $651.  As
      of 9/30/07 there is an escrow balance for MD-08 in-kinds in the amount of $2,099.79.  The
      Level 4 error message is due to foreign addresses. These addresses are reported
      in full and the street address line. The foreign addresses affected are for:
      Active Core Technologies, Sima Kitchen, Hilton Hotel, Sbaro Duzungoff, Mizpe-Hayamim
      Hotel, American Colony Hotel, King David Hotel, Kbliir Restaurant and The David
      Citadel Hotel, all of which are reported on Schedule H4.  1st Amendment Explanation:
      Amendment is being filed to clarify the description of those expenses previously
      reported on Schedule H4 with a description of non-accountable expense allowance.
      These descriptions have been changed to car allowance since they represent car
      allowance stipend payments paid to these individuals that will be added to their
      taxable wages for 2007 and included in their W-2. These amounts are reported
      in the same manner as the compensation reported to these individuals as there
      were no employees who spent more than 25% of their compensated time during the
      reporting period on Federal election activities or activities in connection
      with a Federal election. A total of $250 in contributions are now being reported
      as Itemized contributions on Schedule A when they were previously not itemized.
      It was discovered that some new contribution records were created when they
      shouldnt have been, so those records have now been merged and the result is
      that these contributions are now itemized.  2nd Amendment Explanation: This
      amendment to the original report is to remove an in-kind contribution in the
      amount of $1,274.18 originally reported on page 117, included in line 11(a)(i)
      and included on line 21b. This contribution was actually an in-kind contribution
      to the State account and that report is being amended to properly report this
      in-kind contribution.  '
